tions or scientific truths from data. There are many modes of performing inference including statistical modeling, data oriented strategies and explicit use of designs and randomization in analyses. Furthermore, there are broad theories (frequentists, Bayesian, likelihood, design based, …) and numerous complexities (missing data, observed and unobserved confounding, biases) for performing inference. A practitioner can often be left in a debilitating maze of techniques, philosophies and nuance. This course presents the fundamentals of inference in a practical approach for getting things done. After taking this course, students will understand the broad directions of statistical inference and use this information for making informed choices in analyzing data.","id":"YfjiOHROEeWLqw7zlLhRzQ","slug":"statistical-inference","name":"Statistical Inference","startDate":1451943291928,"courseProgress":"159559572~YfjiOHROEeWLqw7zlLhRzQ","v2Details":{"plannedLaunchDate":"January 4, 2016","id":"YfjiOHROEeWLqw7zlLhRzQ","onDemandSessions":["xFpzjmzmEeiNyA5If3x2rA","7IWI_WuUEe6sTxJwQJ9Iiw","7vnTGCdjEe-FZBKMq_-bcQ","Mw2NZevbEeaYmQ7DfRQSPg","UiKjLZgGEeyCMxI8tI-g-w","9JxXjM8HEeyylQrU6QLj9w","E81b_Ip-EeuWZxL58RI5cw","5i3NU-oYEe6SUBKMJ1f3Ew","9ptFcoLmEeiKFw5LeHdHQg","XZkxKDycEe-9aQ7RciQrRQ","RPwg5K7oEeik3Qqfk5J7qA","T5sO_FltEem9Mgo8FZ640g","SlOEi-PTEeWRzQ4_3k9zNw","ST6-3BaKEe2k4QqerbxZVw","ks-5bxzrEem-BQ4_oLPE-g","Ho2nxt5TEeW0gBLNziwTrw","YrnW3iwbEe-JvAr_wrAWOQ","aHhbuV4MEe2A1Q7gKYj7yw","nU9f5NrpEeizMBIPdjIScg","wASZ5WYUEe6APw7W_MxGSw","ZNSsXl7tEemrmQrSfFxOXg","h_-43D3sEemRng5vYb3aKg","Wqf467kHEeyu7A7GcFzrrQ","4jjFDDZVEeafvg5vT2733w","0n6KY7TZEeartA7xx5gbGg","HE8wrL74Eeq0SQ55xJDyPQ","asqnlRwKEe2xZAosP5mEcw","5EZoWsmHEeycEwr4PZCi1Q","gCmuSH_uEem1_w4YIFemzA","Zb0TxpV-Eeuk8xJAEpJuUw","PS6V8t3iEeeelw5rF-0c1g","76y0-VFlEeiJ9gqpwQmdHg","OolkisVaEeaP2goq4S49oA","l2UWoNXaEeaLkg7jfMokmA","YM4KeSTzEeqHJRL_p4FT6Q","_uQ7-xOREe6CuA6w_8jvmQ","7S78vHz2EeqdgxJRpXkoCQ","x5ixbAOBEeyGUw5kT8l_aQ","zgj5Y6B-E cription":"Learn the basics of creating data products using Shiny, R packages, and interactive graphics. This is the ninth course in the Johns Hopkins Data Science Specialization.","name":"Developing Data Products","id":"v1-1306","slug":"devdataprod","courseProgress":"159559572~v1-1306","v2Details":"v1-1306","membershipIds":[],"memberships":[]},{"courseType":"v2.ondemand","description":"Before you can work with data you have to get some. This course will cover the basic ways that data can be obtained. The course will cover obtaining data from the web, from APIs, from databases and from colleagues in various formats. It will also cover the basics of data cleaning and how to make data “tidy”. Tidy data dramatically speed downstream data analysis tasks. The course will also cover the components of a complete data set including raw data, processing instructions, codebooks, and processed data. The course will cover the basics needed for collecting, cleaning, and sharing data.","id":"HkJsxW0yEeWEewoyD2Bc5Q","slug":"data-cleaning","name":"Getting and Cleaning Data","startDate":1451942295359,"courseProgress":"159559572~HkJsxW0yEeWEewoyD2Bc5Q","v2Details":{"plannedLaunchDate":"January 4, 2016","id":"HkJsxW0yEeWEewoyD2Bc5Q","onDemandSessions":["Sim3N3VfEee_GQqWGbEKWA","PMi8-B9zEeqUSg47sMuaxw","Tt2BvGl9EeuiLwp7zDTNdQ","EXuxbT18EeuAExJmkaX8Ew","H-MyA7bwEemOoxJ9AEh7JA","cN_blLD_Eeuu3xL6NFUOkw","SdK_pJh3Eeqz_RKWrpu__Q","UXp4doNYEealUhJDHjoXqw","u5gGvpjnEeiTig64zxyJJg","WE-uAC9DEea3ThLvjcf5Xw","hykf3f7jEee0IhIZsU05Jg","PCXl_ugBEeu63w62blMydw","vC7LkmTeEeeoNBLy-QPjJA","ApUrqaWPEe2_AAoJPR8I1w","0eA00x8CEeyYpQ4sXRWKnw","0T7MZD-TEe69nQ7HkGBmZw","79D62aAOEe2UNw4RGWeyxw","D0rk6ZDgEeeCIQ5FAgGDcA","x3-Mi1j8Eeu9rg6GWqmNCw","UNWZgA4SEe6dIBJU4i8v7w","7h7kfLl3EeqYhQ5jeYohyw","1QOWqmzmEeibvBL7sCNOVg","TDjQLr74Eeqi0hL_Ya5wIQ","NV_zumF1EeqNbxIwi5IIUw","AojtPwbrEembZRIjSo4MTg","ayyyaqDvEem-RxJgvDvMYg","wNwrmLP3EeqJyQ6sfv_Vqw","_XK5nL4cEe6seRJi4WhMLw","yU5rySrkEeiV2wowhxz3Ag","rXxXAPKREe2LFwrl4GEe
